import banner0 from "../../Assets/images/banner-4.jpeg";
import banner1 from "../../Assets/images/blog-img-1.jpeg";
import banner2 from "../../Assets/images/slider-2.jpeg";
import banner3 from "../../Assets/images/grocery-banner-2.jpeg";
import banner4 from "../../Assets/images/grocery-banner.png";
import banner5 from "../../Assets/images/blog-img-2.jpeg";
import banner6 from "../../Assets/images/blog-img-2.jpeg";
import MainSlider from "../MainSlider/MainSlider";
import ProductSlider from "../ProductSlider/ProductSlider";
import CategorySlider from "../CategorySlider/CategorySlider";
import Product from "../Products/Products";

export default function Home() {
  return (
    <>
      <div>
        <MainSlider />
        <CategorySlider />
        <Product />
      </div>
    </>
  );
}
